TotalAvgPremiumPerCu_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = filter q by 'POLICY_EXPIRED' == "ACTIVE";
q = group q by 'Agent_AGENT_NAME';
q = foreach q generate 'Agent_AGENT_NAME' as 'Agent_AGENT_NAME', sum('written_base_premium') as 'C', unique('POLICY_ID') as 'A', case when 'Agent_AGENT_NAME' == "{{cell(AgencyName_1.selection, 0, "Agent_AGENT_NAME").asObject()}}" then "Yes" else "No" end as 'selected';
q = group q by ('Agent_AGENT_NAME','selected');
q = foreach q generate 'Agent_AGENT_NAME', round(sum(C)/sum(A)) as 'AvgPremiumPerCustomer',rank() over([..] partition by all order by (sum(C)/sum(A)) desc) as 'rank', 'selected' as 'selected';
q = order q by ('AvgPremiumPerCustomer' desc);

